const styles = theme => ({
  drawerHeader: {
    display: "flex",
    alignItems: "center",
    padding: theme.spacing(0, 1, 1, 2),
    // necessary for content to be below app bar
    ...theme.mixins.toolbar,
    justifyContent: "flex-start",
  },
  mainArea: {
    marginTop: theme.spacing(3),
  },
  listHead: {
    flexGrow: 1,
    fontWeight: 600,
    fontSize: 15,
  }
});

export default styles;
